import './App.css';
import Navbar from './components/navbar/Navbar'
import Slider from './components/slider/Slider'
import { SliderData } from './components/slider/SliderData';
function App() {
  return (
    <div className="App">
       <Navbar/>
       <Slider slides={SliderData} />
    </div>
  );
}

export default App;
